import React from 'react';

function HistoryList({ history }) {
  return (
    <div>
      <h2>History</h2>
      <ul>
        {history.map(h => (
          <li key={h.id}>{h.tagline} ({h.tone})</li>
        ))}
      </ul>
    </div>
  );
}

export default HistoryList;
